import React, { useState, useEffect } from 'react';

const Dropdown = ({ label, isOpen, toggleOpen, children }) => (
  <div className="dropdown">
    <h3 onClick={toggleOpen} style={{ cursor: 'pointer' }}>
      {isOpen ? '▼' : '▶'} {label}
    </h3>
    {isOpen && children}
  </div>
);

const EntityTypeDropdown = ({ type, entities }) => {
  const [isOpen, setIsOpen] = useState(false);
  return (
    <Dropdown label={`${type} (${entities.length})`} isOpen={isOpen} toggleOpen={() => setIsOpen(!isOpen)}>
      <ul>
        {entities.map((entity, index) => (
          <li key={index}>{entity.displayName || entity.id}</li>
        ))}
      </ul>
    </Dropdown>
  );
};

const DataTypeDropdown = ({ label, data }) => {
  const [isOpen, setIsOpen] = useState(false);
  return (
    <Dropdown label={label} isOpen={isOpen} toggleOpen={() => setIsOpen(!isOpen)}>
      <ul>
        {Object.entries(data).map(([key, value]) => (
          <li key={key}>{`${key}: ${value}`}</li>
        ))}
      </ul>
    </Dropdown>
  );
};

function EntityDetails({ nodes }) {
  const [entityTypes, setEntityTypes] = useState({});
  const [personalDataTypes, setPersonalDataTypes] = useState({});
  const [isEntityInfoOpen, setIsEntityInfoOpen] = useState(false);
  const [isAdditionalInfoOpen, setIsAdditionalInfoOpen] = useState(false);
  const [groupStats, setGroupStats] = useState({});

  useEffect(() => {
    const types = {};
    const dataTypes = {
      'Address': new Set(),
      'Country': new Set(['US']),
      'Postal Code': new Set(),
    };
    let documentCount = 0;
    let transactionCount = 0;

    nodes.forEach(node => {
      if (!types[node.type]) {
        types[node.type] = [];
      }
      types[node.type].push(node.data);

      if (node.data.info) {
        if (node.data.info.Address) dataTypes['Address'].add(node.data.info.Address);
        if (node.data.info.PostalCode) dataTypes['Postal Code'].add(node.data.info.PostalCode);
      }

      if (node.type === 'Transfer' || node.type === 'BillPay') {
        transactionCount++;
      }

      documentCount++;
    });

    setEntityTypes(types);
    setPersonalDataTypes(dataTypes);
    setGroupStats({
      documentCount,
      transactionCount,
    });
  }, [nodes]);
  return (
    <div className="details-panel">
      <div className="details-header">
        <h2>Details</h2>
      </div>

      <Dropdown
        label="Entity Info"
        isOpen={isEntityInfoOpen}
        toggleOpen={() => setIsEntityInfoOpen(!isEntityInfoOpen)}
      >
        <div className="nested-content">
          <div className="entity-types">
            {Object.entries(entityTypes).map(([type, entities]) => (
              <EntityTypeDropdown key={type} type={type} entities={entities} />
            ))}
          </div>
          <div className="personal-data-types">
            {Object.entries(personalDataTypes).map(([label, values]) => (
              <DataTypeDropdown
                key={label}
                label={label}
                data={Object.fromEntries([...values].map((value, index) => [index + 1, value]))}
              />
            ))}
          </div>
        </div>
      </Dropdown>
      <Dropdown
        label="Additional Information"
        isOpen={isAdditionalInfoOpen}
        toggleOpen={() => setIsAdditionalInfoOpen(!isAdditionalInfoOpen)}
      >
        <div className="nested-content">
          <div className="group-stats">
            <DataTypeDropdown
              label="Document Count"
              data={{ "Total": groupStats.documentCount }}
            />
            <DataTypeDropdown
              label="Transaction Count"
              data={{ "Total": groupStats.transactionCount }}
            />
          </div>
        </div>
      </Dropdown>
    </div>
  );
}

export default EntityDetails;
